import React, { useState } from 'react';
import { FaEnvelope, FaInstagram, FaLinkedin, FaFacebook } from 'react-icons/fa';

const Contact = () => {
  const [formData, setFormData] = useState({
    firstName: '',
    surname: '',
    email: '',
    subject: '',
    inquiry: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    
    // Créer le corps du mail avec les données du formulaire
    const mailtoLink = `mailto:fbouazi3@gmail.com?subject=${encodeURIComponent(formData.subject)}&body=${encodeURIComponent(
      `From: ${formData.firstName} ${formData.surname}
Email: ${formData.email}

${formData.inquiry}`
    )}`;
    
    // Ouvrir le client mail par défaut
    window.location.href = mailtoLink;
  };

  return (
    <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
      <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
        {/* Formulaire de contact */}
        <div className="md:col-span-2">
          <h1 className="text-4xl font-bold text-gray-900 mb-8">Contact</h1>
          <form onSubmit={handleSubmit} className="space-y-6">
            <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
              <input
                type="text"
                name="firstName"
                placeholder="First given name"
                value={formData.firstName}
                onChange={handleChange}
                className="w-full px-4 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
                required
              />
              <input
                type="text"
                name="surname"
                placeholder="Surname"
                value={formData.surname}
                onChange={handleChange}
                className="w-full px-4 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
                required
              />
            </div>
            <input
              type="email"
              name="email"
              placeholder="Email address"
              value={formData.email}
              onChange={handleChange}
              className="w-full px-4 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              required
            />
            <input
              type="text"
              name="subject"
              placeholder="Subject"
              value={formData.subject}
              onChange={handleChange}
              className="w-full px-4 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              required
            />
            <textarea
              name="inquiry"
              placeholder="Inquiry"
              value={formData.inquiry}
              onChange={handleChange}
              rows="6"
              className="w-full px-4 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              required
            />
            <button
              type="submit"
              className="bg-gray-800 text-white px-6 py-2 rounded-md hover:bg-gray-700 transition-colors"
            >
              Submit
            </button>
          </form>
        </div>

        {/* Quick Contact */}
        <div className="md:col-span-1">
          <h2 className="text-2xl font-bold text-gray-900 mb-4">Quick Contact</h2>
          <a href="mailto:charaf.lahib@gmail.com" className="text-gray-700 hover:text-gray-900 mb-6 block">
            charaf.lahib@gmail.com
          </a>
          <div className="flex space-x-4 mt-4">
            <a href="mailto:charaf.lahib@gmail.com" className="text-gray-700 hover:text-gray-900">
              <FaEnvelope size={24} />
            </a>
            <a href="https://www.instagram.com/charaflahib" target="_blank" rel="noopener noreferrer" className="text-gray-700 hover:text-gray-900">
              <FaInstagram size={24} />
            </a>
            <a href="https://www.linkedin.com/in/charaflahib" target="_blank" rel="noopener noreferrer" className="text-gray-700 hover:text-gray-900">
              <FaLinkedin size={24} />
            </a>
            <a href="https://www.facebook.com/charaflahib" target="_blank" rel="noopener noreferrer" className="text-gray-700 hover:text-gray-900">
              <FaFacebook size={24} />
            </a>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Contact;
